import { makeStyles } from "@material-ui/core";
import React from "react";
import loader from '../assets/myText.svg'

const style = makeStyles((theme) => ({
  root: {
    textAlign: "left",
    position: "absolute",
  },
}));

const Loader = () => {
  const classes = style();
  return <div className={classes.root}>
      <img src={loader}></img>
  </div>;
};
export default Loader;
